import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({  

        root: {

        },
        buttonOrange: { //this is using hooks
            backgroundColor: "#E5AB2C",
        },
        buttonBlue: {
            color: "#43C0F6",
        }
}));


export default function ContainedButtons() {
  const classes = useStyles(); //this is using hooks

  return (
    <div className={classes.root}>
      <Button className={classes.buttonOrange} variant="contained" color="secondary">
        Take Screenshot
      </Button>
    <div className={classes.buttonRed}>
      <Button variant="contained" color="secondary">
        Help Centre
      </Button>
      </div>
    <div className={classes.buttonBlue}>
      <Button variant="contained" color="secondary">
        More Projects
      </Button>
    </div>
    </div>
  );
}
